statustext[261955]="The subway is closed each night between 1 AM and 5 AM while we clean our trains and stations.<br>$$<br>We are running extra bus service overnight, including new interborough routes. <br><br><a  href=http://new.mta.info target=_blank>Plan your bus trip on our homepage</a>  . Be sure to set the time for your overnight trip, and select &quot;bus&quot; and &quot;express bus&quot; under Travel Preferences.<br><br><br>";
statustext[264269]="The subway will be closed each night between 1 AM and 5 AM while we clean our trains and stations.<br>$$<br>We will run extra bus service overnight, including new interborough routes. <br><br><a  href=http://new.mta.info target=_blank>Plan your bus trip on our homepage</a>  . Be sure to set the time for your overnight trip, and select &quot;bus&quot; and &quot;express bus&quot; under Travel Preferences.<br><br><a  href=http://mta.info/overnight target=_blank>See the last time to catch a train at your station.</a>  <br>";
statustext[264618]="ALTERNATIVE SERVICE  Weekends until Dec 21*, Fri 9:45 PM to Mon 1 AM  <img src='images/routes/14px/N.gif' align='bottom' /> Trains run local in both directions between DeKalb Av and 59 St, Brooklyn<br>$$<br><img src='images/routes/14px/N.gif' align='bottom' /> trains provide connecting service in Brooklyn between 4 Av-9 St <img src='images/routes/14px/F.gif' align='bottom' /> and Coney Island-Stillwell Av, during weekend planned work for the <a  href=http://www.mta.info/press-release/nyc-transit/mta-track-begin-next-phase-signal-modernization-culver-f-line-southern target=_blank>Culver Line Signal Modernization</a>  .<br><br>Reminder: No subway service overnight from 1 AM to 5 AM.<br><br>*Except Nov 27 - 30.<br><br>";
statustext[268703]="TRACK MAINTENANCE  Weekends until Nov 22, Sat 5:45 AM to Sun 10 PM  <img src='images/routes/14px/2.gif' align='bottom' /> No trains between 241 St and E 180 St<br>$$<br><img src='images/routes/14px/2.gif' align='bottom' /> trains run between Flatbush Av and E 180 St and via the <img src='images/routes/14px/5.gif' align='bottom' /> to/from Dyre Av.<br><br><img src='images/routes/14px/shuttle_bus.png' align='bottom' /> Free shuttle buses make all stops between E 180 St and 241 St.<br>&bull; Transfer between <img src='images/routes/14px/2.gif' align='bottom' /> trains and <img src='images/routes/14px/shuttle_bus.png' align='bottom' /> buses at E 180 St <img src='images/ADA_WhlChr_small.gif'  />.<br><br><span id='moretext' style='color:Blue; text-decoration:underline; cursor:pointer;' onclick=ShowCompleteStatus(268703)>Click here for more info</span>";
statustext[268714]="SIGNAL MAINTENANCE  Weekends until Nov 23, Fri 10 PM to Mon 1 AM  <img src='images/routes/14px/A.gif' align='bottom' /> Downtown trains stop at 50 St, 23 St and Spring St<br>$$<br>Reminder: No subway service overnight from 1 AM to 5 AM.<br><br>";
statustext[269019]="TRACK MAINTENANCE  Nov 14 - 15  &bull;  Nov 21 - 22, Sat 5:45 AM to Sun 10 PM  <img src='images/routes/14px/5.gif' align='bottom' /> Trains are replaced by the <img src='images/routes/14px/2.gif' align='bottom' /> between E 180 St and Dyre Av<br>$$<br><img src='images/routes/14px/5.gif' align='bottom' /> trains run every 20 minutes between Bowling Green and E 180 St*, days and evenings.<br><br>&bull; Transfer between <img src='images/routes/14px/2.gif' align='bottom' /> and <img src='images/routes/14px/5.gif' align='bottom' /> trains at E 180 St.<br><br>*<img src='images/routes/14px/5.gif' align='bottom' /> service between Bowling Green and E 180 St is suspended 7:45 AM to 10 AM, Sunday, Nov 15.<br><br>Reminder: No subway service overnight from 1 AM to 5 AM.<br><br>";
statustext[269023]="ELECTRICAL IMPROVEMENTS  Nov 14 - 16  &bull;  Nov 21 - 23, Sat 12:01 AM to Mon 1 AM  <img src='images/routes/14px/F.gif' align='bottom' /> Trains run local in both directions between 21 St-Queensbridge and 71 Av<br>$$<br>Trains stop at 36 St, Steinway St, 46 St, Northern Blvd, 65 St, Roosevelt Av, Elmhurst Av, Grand Av, Woodhaven Blvd, 63 Dr and 67 Av.<br><br>Reminder: No subway service overnight from 1 AM to 5 AM.<br><br>";
statustext[269029]="ELECTRICAL IMPROVEMENTS  Nov 14 - 16, Sat 12:01 AM to Mon 1 AM  <img src='images/routes/14px/E.gif' align='bottom' /> Trains run local in both directions in Queens<br>$$<br>Trains stop at 36 St, Steinway St, 46 St, Northern Blvd, 65 St, Roosevelt Av, Elmhurst Av, Grand Av, Woodhaven Blvd, 63 Dr and 67 Av.<br><br>Reminder: No subway service overnight from 1 AM to 5 AM.<br><br>";
statustext[269242]="TRACK MAINTENANCE  Nov 15, Sunday, 7:45 AM to 10 AM  <img src='images/routes/14px/5.gif' align='bottom' /> No trains running - Take the <img src='images/routes/14px/2.gif' align='bottom' /> <img src='images/routes/14px/4.gif' align='bottom' /> instead<br>$$<br><img src='images/routes/14px/2.gif' align='bottom' />* trains make <img src='images/routes/14px/5.gif' align='bottom' /> stops between Dyre Av and 149 St-Grand Concourse.<br><img src='images/routes/14px/4.gif' align='bottom' /> trains make all <img src='images/routes/14px/5.gif' align='bottom' /> stops between 149 St-Grand Concourse and Bowling Green.<br><br>Transfer between trains at 149 St-Grand Concourse <img src='images/routes/14px/2.gif' align='bottom' /> <img src='images/routes/14px/4.gif' align='bottom' />.<br><br>*3 Av-149 St - board/exit all trains at the Wakefield-bound platform.<br><br>Note: Uptown <img src='images/routes/14px/5.gif' align='bottom' /> service from Bowling Green begins at approximately 11 AM.<br><br><img src='images/ADA_WhlChr_small.gif'  /> This service change affects one or more ADA accessible stations and these travel alternatives may not be fully accessible. Please contact 511 to plan your trip.<br><br>";
