statustext[269250]="STRUCTURAL IMPROVEMENTS  Nov 14 - 16  &bull;  Nov 21 - 23, Sat 12:01 AM to Mon 1 AM  <img src='images/routes/14px/4.gif' align='bottom' /> Woodlawn-bound trains skip Eastern Pkwy, Grand Army Plaza and Bergen St<br>$$<br>For service to these stations, take the <img src='images/routes/14px/4.gif' align='bottom' /> to Atlantic Av-Barclays Ctr and transfer to a Flatbush Av-bound <img src='images/routes/14px/2.gif' align='bottom' /> or New Lots Av-bound <img src='images/routes/14px/4.gif' align='bottom' /> local.<br><br>For service from these stations, take the <img src='images/routes/14px/2.gif' align='bottom' /> or <img src='images/routes/14px/4.gif' align='bottom' /> to Franklin Av-Medgar Evers College and transfer to a Woodlawn-bound <img src='images/routes/14px/4.gif' align='bottom' />.<br><br>Reminders:<br>Express service runs as scheduled in Brooklyn, days and evenings.<br>No subway service overnight from 1 AM to 5 AM.<br><br>";
