statustext[269259]="STATION MAINTENANCE  Nov 14 - 15, Sat 5 AM to Sun 10 PM  <img src='images/routes/14px/6.gif' align='bottom' /> Pelham Bay Park-bound trains skip Longwood Av<br>$$<br>Travel Alternatives:<br>For service to this station, take the <img src='images/routes/14px/6.gif' align='bottom' /> to Hunts Point Av and transfer to a Brooklyn Bridge-bound <img src='images/routes/14px/6.gif' align='bottom' />.<br><br>For service from this station, take the northbound Bx19 bus to Hunts Point Av and transfer to a Pelham Bay Park-bound <img src='images/routes/14px/6.gif' align='bottom' />. Or, take a Manhattan-bound <img src='images/routes/14px/6.gif' align='bottom' /> to 3 Av-138 St and transfer to a Pelham Bay Park-bound <img src='images/routes/14px/6.gif' align='bottom' />.<br><br>Reminder: No subway service overnight from 1 AM to 5 AM.<br><br>";
statustext[269289]="TRACK MAINTENANCE  Nov 13 - 16, Fri 9:30 PM to Mon 1 AM  <img src='images/routes/14px/D.gif' align='bottom' /> Service is rerouted in Manhattan and Brooklyn<br>$$<br><img src='images/routes/14px/D.gif' align='bottom' /> trains run between Norwood-205 St and 145 St and via the <img src='images/routes/14px/C.gif' align='bottom' /> to/from W 4 St and via the <img src='images/routes/14px/F.gif' align='bottom' /> to/from Church Av, the last stop.<br><br><img src='images/routes/14px/F.gif' align='bottom' /> trains replace the <img src='images/routes/14px/D.gif' align='bottom' /> between 47-50 Sts and Stillwell Av.<br><br>For 7 Av, use nearby <a  href=http://web.mta.info/weekender/tileMap.html?staID=18538 target=_blank>50 St</a>   <img src='images/routes/14px/C.gif' align='bottom' /> <img src='images/routes/14px/E.gif' align='bottom' /> station or take an uptown <img src='images/routes/14px/E.gif' align='bottom' />.<br><br>&bull; Transfer at W 4 St <img src='images/routes/14px/D.gif' align='bottom' />, uptown <img src='images/routes/14px/E.gif' align='bottom' />, <img src='images/routes/14px/F.gif' align='bottom' /> or 42 St/Port Authority <img src='images/routes/14px/D.gif' align='bottom' />, uptown <img src='images/routes/14px/E.gif' align='bottom' />.<br><br>Reminder: No subway service overnight from 1 AM to 5 AM.<br><br><img src='images/ADA_WhlChr_small.gif'  /> This service change affects one or more ADA accessible stations and these travel alternatives may not be fully accessible. Please contact 511 to plan your trip.<br><br>";
statustext[269290]="TRACK MAINTENANCE  Nov 13 - 16  &bull;  Nov 20 - 23, Fri 9:30 PM to Mon 1 AM  <img src='images/routes/14px/F.gif' align='bottom' /> Service is rerouted between W 4 St and Stillwell Av<br>$$<br><img src='images/routes/14px/F.gif' align='bottom' /> trains replace the <img src='images/routes/14px/D.gif' align='bottom' /> in both directions between W 4 St and Stillwell Av.<br><br><img src='images/routes/14px/D.gif' align='bottom' /> trains replace the <img src='images/routes/14px/F.gif' align='bottom' /> in both directions between W 4 St and Church Av.<br><br>&bull; Transfer between <img src='images/routes/14px/D.gif' align='bottom' /> and <img src='images/routes/14px/F.gif' align='bottom' /> trains at W 4 St <img src='images/ADA_WhlChr_small.gif'  />.<br><br>Reminder: No subway service overnight from 1 AM to 5 AM.<br><br>";
statustext[269291]="TRACK MAINTENANCE  Nov 13 - 16, Fri 9:30 PM to Mon 1 AM  <img src='images/routes/14px/E.gif' align='bottom' /> World Trade Center-bound trains run via the <img src='images/routes/14px/F.gif' align='bottom' /> from 47-50 Sts to W 4 St<br>$$<br>No World Trade Center-bound <img src='images/routes/14px/E.gif' align='bottom' /> service at 7 Av, 50 St, 42 St/Port Authority, 34 St-Penn Station, 23 St and 14 St.<br><br>Travel Alternatives:<br>For 7 Av, use nearby <a  href=http://web.mta.info/weekender/tileMap.html?staID=18664 target=_blank>57 St-7 Av</a>   <img src='images/routes/14px/N.gif' align='bottom' /> <img src='images/routes/14px/Q.gif' align='bottom' /> <img src='images/routes/14px/R.gif' align='bottom' /> station via transfer at 34 St-Herald Sq or take an uptown <img src='images/routes/14px/E.gif' align='bottom' /> via transfer at W 4 St.<br><br>For service to 50 St*, 42 St, 34 St, 23 St* and 14 St, use nearby <img src='images/routes/14px/F.gif' align='bottom' /> stations along 6 Av or take the <img src='images/routes/14px/E.gif' align='bottom' /> to W 4 St and transfer to an uptown <img src='images/routes/14px/A.gif' align='bottom' /> local, <img src='images/routes/14px/C.gif' align='bottom' />, <img src='images/routes/14px/D.gif' align='bottom' /> making these stops during this time or <img src='images/routes/14px/E.gif' align='bottom' />.<br><br>For service from these stations, take the <img src='images/routes/14px/A.gif' align='bottom' /> <img src='images/routes/14px/C.gif' align='bottom' /> or <img src='images/routes/14px/D.gif' align='bottom' /> instead.<br><br>*No uptown <img src='images/routes/14px/C.gif' align='bottom' /> during this time.<br><br><img src='images/ADA_WhlChr_small.gif'  /> This service change affects one or more ADA accessible stations and these travel alternatives may not be fully accessible. Please contact 511 to plan your trip.<br><br>";
statustext[269293]="TRACK MAINTENANCE  Nov 14 - 15, Saturday & Sunday  <img src='images/routes/14px/C.gif' align='bottom' /> Uptown trains run express from Canal St to 145 St<br>$$<br>Trains stop at W 4 St, 14 St, 34 St-Penn Station, 42 St-Port Authority, 59 St-Columbus Circle and 125 St.<br><br>For Spring St, take the <img src='images/routes/14px/E.gif' align='bottom' /> instead. Transfer between trains at Canal St or W 4 St.<br><br>For 23, 50, 72, 81, 86, 96, 103, 110, 116 and 135 Sts, take an uptown <img src='images/routes/14px/D.gif' align='bottom' /> making these stops during this time. Transfer between trains at W 4 St, 14 St, 42 St-Port Authority, 59 St-Columbus Circle, 125 St or 145 St.<br><br>Travel tip:<br>Uptown <img src='images/routes/14px/E.gif' align='bottom' /> trains stop at 23 St and 50 St.<br><br>";
statustext[269294]="CULVER LINE SIGNAL MODERNIZATION  Nov 13 - 16  &bull;  Nov 20 - 23, Fri 9:45 PM to Mon 1 AM  <img src='images/routes/14px/F.gif' align='bottom' /> No trains between Church Av and Coney Island-Stillwell Av  <img src='images/routes/14px/D.gif' align='bottom' /> Trains replace the <img src='images/routes/14px/F.gif' align='bottom' /> in Brooklyn<br>$$<br><a  href=http://www.mta.info/press-release/nyc-transit/mta-track-begin-next-phase-signal-modernization-culver-f-line-southern target=_blank>Learn more about this project</a>  <br><img src='images/routes/14px/D.gif' align='bottom' /> trains replace the <img src='images/routes/14px/F.gif' align='bottom' /> between W 4 St and Church Av, the last stop.<br><br><img src='images/routes/14px/F.gif' align='bottom' /> trains run between 179 St and W 4 St and replace the <img src='images/routes/14px/D.gif' align='bottom' /> to/from Stillwell Av.<br><br>Nearby <img src='images/routes/14px/F.gif' align='bottom' /> <img src='images/routes/14px/N.gif' align='bottom' /> <img src='images/routes/14px/Q.gif' align='bottom' /> trains and local buses provide alternate service between Church Av and Stillwell Av.<br><br>For direct service between Manhattan/Downtown Brooklyn and Coney Island, take the <img src='images/routes/14px/F.gif' align='bottom' /> <img src='images/routes/14px/N.gif' align='bottom' /> or <img src='images/routes/14px/Q.gif' align='bottom' /> instead.<br><br>For West 8 St-NY Aquarium, take the <img src='images/routes/14px/Q.gif' align='bottom' /> instead.<br><span id='moretext' style='color:Blue; text-decoration:underline; cursor:pointer;' onclick=ShowCompleteStatus(269294)>Click here for more info</span>";
